  <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.8.0/gsap.min.js"></script>
  <script>
let canPaint = false;
let erase = false;
$(".grid_item").on("mousedown", function () {
  if (erase == false) {
    $(this).addClass("active");
  } else {
    $(this).removeClass("active");
  }
});
$("body").on("mousedown", function () {
  canPaint = true;
});
$("body").on("mouseup", function () {
  canPaint = false;
});
$(".grid_item").on("mousemove", function () {
  if (canPaint == true) {
    if (erase == false) {
      $(this).addClass("active");
    } else {
      $(this).removeClass("active");
    }
  }
});
$(".control_link.paint").on("click", function () {
  erase = false;
  $(this).addClass("active-tool");
  $(this).siblings().removeClass("active-tool");
});
$(".control_link.erase").on("click", function () {
  $(this).addClass("active-tool");
  $(this).siblings().removeClass("active-tool");
  erase = true;
});
$(".delete").on("click", function () {
  var tl = gsap.timeline({ repeat: 0 });
  tl.to(".grid_item.active", {
    duration: 0,
    scale: 0,
    ease: "power1.inOut",
    stagger: {
      grid: "auto",
      from: "random",
      ease: "power3.inOut",
      amount: 0.7
    }
  });
  tl.add(function () {
    // on complete
    $(".grid_item").css("transform", "scale(1)");
    $(".grid_item").removeClass("active");
  });
});
</script>
